[{"location":"lib/functions/","page":"Functions","title":"Functions","text":"Modules = [Carla]\nPages   = [\"functions/latent_responsevecs.jl\"]","category":"page"},{"location":"lib/functions/#Carla.emission_responsevec-Tuple{ResponseFunction, Any, Any, Any, Any}","page":"Functions","title":"Carla.emission_responsevec","text":"emission_responsevec(\n    EmissionType::ResponseFunction, QMatrix::Matrix,\n    itemID::Integer, t::Integer, αMatrix::Matrix\n)\n\nComputes the local emission response vectors psi_jt (alpha) \n\npsi_jt (alpha) =\nbegincases\n1 Pi_k in S_jt alpha_k  text  if DINA-type emission \n1 1 - Pi_k in S_jt (1 - alpha_k)  text  if DINO-type emission \n1 fracSigma_k in S_jt alpha_kK  text  if FUZZYDINA-type emission\nendcases\n\nArguments\n\nEmissionType: Emission Response Type (DINA(),DINO(), or FUZZYDINA())\nQMatrix: J (No. of Items) × K (No. of Skills) Matirx\nitemID:  Integer denoting the jth item \nt: time index\nαMatrix: K (No. of Skills) × T (No. of Timepoints) Matrix\n\nOutput:\n\nA 2-element Vector{Float64}\n\n\n\n\n\n","category":"method"},{"location":"lib/functions/#Carla.transition_responsevec-Tuple{ResponseFunction, Any, Any, Any, Any}","page":"Functions","title":"Carla.transition_responsevec","text":"transition_responsevec(\n    EmissionType::ResponseFunction, RMatrix::Matrix,\n    skillID::Integer, t::Integer, αMatrix::Matrix\n)\n\nComputes the local transition response vectors phi_kt (alpha)\n\nphi_kt (alpha) =\nbegincases\n1 Pi_k in S_kt alpha_k  text  if DINA-type emission \n1 1 - Pi_k in S_kt (1 - alpha_k)  text  if DINO-type emission \n1 fracSigma_k in S_kt alpha_kK  text  if FUZZYDINA-type emission\nendcases\n\nArguments\n\nEmissionType: Emission Response Type (DINA(),DINO(), or FUZZYDINA())\nRMatrix: K (No. of Skills) × K (No. of Skills) Matirx\nskillID:  Integer denoting the jth skill\nt: time index\nαMatrix: K (No. of Skills) × T (No. of Timepoints) Matrix\n\nOutput:\n\nA 2-element Vector{Float64}\n\n\n\n\n\n","category":"method"},{"location":"lib/types/#Probability-Model","page":"Data Structures","title":"Probability Model","text":"","category":"section"},{"location":"lib/types/","page":"Data Structures","title":"Data Structures","text":"Modules = [Carla]\nPages   = [\"datastructs/probmodels.jl\"]","category":"page"},{"location":"lib/types/#Carla.CPM","page":"Data Structures","title":"Carla.CPM","text":"CPM()\nCPM(kwargs...)\n\nCPM is the data structure for Carla Probability Model.\n\nKeword Arguments\n\nemissionprob – Emission Probability function, type of ResponseFunction \ntransitionprob – Transition Probability function, type of ResponseFunction\ninitialvwec – Initial Weight Vector, Vector of Float64\nvarianceprior – Variance Prior, a Float64\nopts – Options for estimands,            by default uses EstimandOpts(initparamnoiseSD = 0.2,                                            estimatebeta = true, estimatedelta = false)\n\nNotes\n\nAll the fields can be assigned using the appropriate keywords. The initialization constructor CPM(), uses the values in the example, as default for the fields in CPM. \n\nExamples\n\njulia> M1 = CPM()\nCPM(DINA(), DINA(), [1.2, 0.6], 0.1865671641791045, EstimandOpts(0.2, true, false))\n\njulia> M2 = CPM(emissionprob = DINO())\nCPM(DINO(), DINA(), [1.2, 0.6], 0.1865671641791045, EstimandOpts(0.2, true, false))\n\njulia> M3 = CPM(emissionprob = DINO(), opts = EstimandOpts(estimatedelta=true))\nCPM(DINO(), DINA(), [1.2, 0.6], 0.1865671641791045, EstimandOpts(0.2, true, true))\n\n\n\n\n\n","category":"type"},{"location":"lib/types/#Carla.EstimandOpts","page":"Data Structures","title":"Carla.EstimandOpts","text":"EstimandOpts()\nEstimandOpts(kwargs...)\n\nSets the options for CPM estimands\n\nKeyword Arguments\n\ninitparamnoiseSD::Float64 - S.D of the random noise to be added during parameter initialization, by default 0.2\nestimatebeta::Bool - should betas be estimated as part of learning, by default true\nestimatedelta::Bool - should deltas be estimated as part of learning, by default false\n\nExample\n\njulia> EstimandOpts()\nEstimandOpts(0.2, true, false)\n\njulia> EstimandOpts(estimatedelta = true)\nEstimandOpts(0.2, true, true)\n\n\n\n\n\n","category":"type"},{"location":"lib/types/#Latent-Response","page":"Data Structures","title":"Latent Response","text":"","category":"section"},{"location":"lib/types/","page":"Data Structures","title":"Data Structures","text":"Modules = [Carla]\nPages   = [\"datastructs/latentresponses.jl\"]","category":"page"},{"location":"lib/types/#Carla.DINA","page":"Data Structures","title":"Carla.DINA","text":"DINA <: ResponseFunction\n\nDINA Response Function\n\n\n\n\n\n","category":"type"},{"location":"lib/types/#Carla.DINO","page":"Data Structures","title":"Carla.DINO","text":"DINO <: ResponseFunction\n\nDINO Response Function\n\n\n\n\n\n","category":"type"},{"location":"lib/types/#Carla.FUZZYDINA","page":"Data Structures","title":"Carla.FUZZYDINA","text":"FUZZYDINA <: ResponseFunction\n\nFUZZYDINA Response Function\n\n\n\n\n\n","category":"type"},{"location":"lib/types/#Carla.ResponseFunction","page":"Data Structures","title":"Carla.ResponseFunction","text":"ResponseFunction\n\nAbstract type for response functions\n\n\n\n\n\n","category":"type"},{"location":"lib/types/#Parameters","page":"Data Structures","title":"Parameters","text":"","category":"section"},{"location":"lib/types/","page":"Data Structures","title":"Data Structures","text":"Modules = [Carla]\nPages   = [\"datastructs/params.jl\"]","category":"page"},{"location":"lib/types/#Carla.GaussianParameterInit","page":"Data Structures","title":"Carla.GaussianParameterInit","text":"GaussianParameterInit(mean::Union{Float64,Vector{Float64}},\n                varianceprior::Float64, noiseSD::Float64 (optional))\n\nInitializes a gaussian parameter prior with the given mean, and co-variance\n\nExamples\n\njulia> GaussianParameterInit(0.5,0.1) \nGaussianParameterInit(0.5, 0.2, 0.1, [10.0;;])\n\njulia> GaussianParameterInit([0.2, 0.6], 0.5)\nGaussianParameterInit([0.2, 0.6], 0.2, 0.5, [2.0 0.0; 0.0 2.0])\n\njulia> GaussianParameterInit([0.2, 0.6], 0.5, 0.5) # Also passing initparamsd (0.5)\nGaussianParameterInit([0.2, 0.6], 0.5, 0.5, [2.0 0.0; 0.0 2.0])\n\n\n\n\n\n","category":"type"},{"location":"lib/types/#Carla.params","page":"Data Structures","title":"Carla.params","text":"params(prior::GaussianParameterInit)\n\nExample\n\njulia> M1 = CPM()\nCPM(DINA(), DINA(), [1.2, 0.6], 0.1865671641791045, EstimandOpts(0.2, true, false))\n\njulia> # Initializing βparams for our M1 model. \njulia>  βparams = params(GaussianParameterInit(M1.initialwvec,\n                                       M1.varianceprior))\nparams(GaussianParameterInit([1.2, 0.6], 0.2, 0.1865671641791045, [5.359999999999999 0.0; 0.0 5.359999999999999]), [1.3862321329853542, 0.6293077030876637])\n\n\n\n\n\n","category":"type"},{"location":"#Carla.jl","page":"Introduction","title":"Carla.jl","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"Welcome to Carla.jl documentation.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Competency-based Assessment using Robust Latent-transition Analysis (CARLA) is a framework for modeling the evolution of a student's latent skills during the course of a semester. Key objectives of this framework are:","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Provide the course instructor with diagnostic information regarding the  probabilities of student's latent skill status \nProvide a psychometric framework for comparing and evaluating exam assessments  and instructional strategies with respect to student latent skill profiles ","category":"page"},{"location":"#This-package-is-under-active-development.","page":"Introduction","title":"This package is under active development.","text":"","category":"section"}]
